-- VERIFICAÇÃO FINAL
-- ============================================
SELECT COUNT(*) as total_lentes FROM lens_catalog.lentes;
-- Esperado: 1411 lentes (705 + 706)

SELECT 
    f.nome as fornecedor,
    COUNT(l.id) as total_lentes
FROM lens_catalog.lentes l
JOIN pessoas.fornecedores f ON l.fornecedor_id = f.id
GROUP BY f.nome
ORDER BY total_lentes DESC;
